import React from 'react';
import '../styles/footer.css'; 

const Footer = () => {
  return (
    <footer>
      <p> © BRANDSHOP, 2024
            
Пользовательское соглашение
          Политика о конфиденциальности</p>
    </footer>
  );
};

export default Footer;
